import './index.scss'
import AnimatedLetters from '../AnimatedLetters'
import { useEffect, useState } from 'react'

const About = () => {
    const [letterClass, setLetterClass] = useState('text-animate')
    useEffect(() => {
        setTimeout(() => {
            setLetterClass('text-animate-hover')
        }, 4000)
    }, [])

    return (
        <div className='container about-page'>
            <div className='text-zone'>
                <h1>
                    <AnimatedLetters
                        letterClass={letterClass}
                        strArray={['A','b','o','u','t',' ','M','e']}
                        idx={15}
                    />
                </h1>
                <p>
                    I'm very Ambitous when it comes to my projects.
                    I'm Looking for internship roles, where I can learn
                    as much as possible.
                </p>
                <p>
                    In my free time I enjoy researching and reading about topics
                    not covered in class. I have participated in traditional coding
                    competitions, and I have hosted and participated in some non-traditional 
                    competitions.
                </p>
                <p>
                    Yes
                </p>
            </div>
        </div>
    )
}

export default About
